import React, { useEffect } from 'react';
import styles from './deep.module.css'; // Importing the CSS module for styles

function Deep() {
  useEffect(() => {
    // Insert script to dynamically load Feather icons
    const script = document.createElement('script');
    script.src = 'https://cdn.jsdelivr.net/npm/feather-icons/dist/feather.min.js';
    script.async = true;
    document.body.appendChild(script);

    // Cleanup function
    return () => {
      document.body.removeChild(script);
    };
  }, []);

  return (
    <div className={styles.menuContainer}>
      <ul className={styles.verticalNav}>
        <li>
          <a href="#"><span data-feather="activity"></span> Fee Schedule DeepDive</a>
          <div className={styles.hoverMenu}>
            <ul>
              <li><a href="#">Menu Item</a></li>
              <li><a href="#">Menu Item</a></li>
              <li><a href="#">Menu Item</a></li>
              
              <li><a href="#">Menu Item</a></li>
              <li><a href="#">Menu Item</a></li>
            </ul>
          </div>
        </li>
        {/* Repeat the same structure for other menu items */}
      </ul>
    </div>
  );
}

export default Deep;
